import React from 'react';
import Head from './Head';
import "./header.css"

const Header = () => {
  return (
    <div>
        <Head />
        <header>
          <nav>
            <ul>
              <li></li>
            </ul>
          </nav>
        </header>
    </div>
  )
}

export default Header
